import React, { useState } from 'react';


const Navbar = () => {
  let Links =[
    {
      name :'Home',
      Link : '/'
    },
    {
      name :'About',
      Link : '/'

    },
    {
      name :'Contact',
      Link : '/'

    },
    {
      name :'Product',
      Link : '/'
    },
    {
      name :'Blog',
      Link : '/'
    }
  ];

  let [active ,setActive] = useState(false);
  const showMenu = () => {
    setActive(!active);
  }

  return (
    <div className='text-teal-300 bg-black flex justify-between items-center'>
      <div className='container'>
      <h1 className='w-full text-3xl font-bold text-[] z-[9999] sticky pl-10'>Kumala.com </h1>
      <ul className=' hidden md:flex '>
        <li className='p-4'>Home</li>
        <li className='p-4'>About</li>
        <li className='p-4'>Product</li>
        <li className='p-4'>Blog</li>
        <li className='p-4'>COntact</li>

      </ul>

      <div onClick={showMenu} className='block md:hidden'>
      <ion-icon name={active ? 'close':'menu'} size="large"></ion-icon>
      </div>

      <div className={active ? ' absolute left-0 top-0 w-[200px] h-[250px] border-r border-r-gray-600 bg-gray-900 z-[9998] ':'hidden'}>
      <ul className='uppercase'>
        <li className='p-4 border-b border-gray-400'>Home</li>
        <li className='p-4 border-b border-gray-400'>About</li>
        <li className='p-4 border-b border-gray-400'>Product</li>
        <li className='p-4 border-b border-gray-400'>Blog</li>
        <li className='p-4 border-b border-gray-400'>COntact</li>

      </ul>
      </div>
      </div>

    </div>
  )
}

export default Navbar
